    [Form]
    public class SalesShipmentDeviation extends FormRun
    {
        int                             daysToLookBefore;
        DateExpectedConfirmedRequested  dateExpectedConfirmedRequested;
        boolean                         daysFiltersApplied;
        [FormObservable]
        SysDictEnum                     enum;

        #define.DefaultDaysToLookBefore(14)

        #define.CurrentVersion(1)
        #localmacro.CurrentList
            dateExpectedConfirmedRequested,
            daysToLookBefore
        #endmacro
}

public void close()
{
    dateExpectedConfirmedRequested = enum.index2Value(basedOn.selection());

    if (daysToLookBack.value())
    {
        daysToLookBefore = daysToLookBack.value();
    }

    xSysLastValue::saveLast(this);

    super();
}

public void init()
{
    enum = new SysDictEnum(enumNum(DateExpectedConfirmedRequested));

    super();

    xSysLastValue::getLast(this);

    basedOn.selection(enum.value2Index(dateExpectedConfirmedRequested));

    if (!daysToLookBefore)
    {
        daysToLookBefore = #DefaultDaysToLookBefore;
    }
    daysToLookBack.value(daysToLookBefore);
    daysFiltersApplied = true;

    this.setControlsVisibility();
}

public void setControlsVisibility()
{
    switch (enum.index2Value(basedOn.selection()))
    {
        case DateExpectedConfirmedRequested::Expected:
            dateExpected.label("@SYS22322");
            dateExpected.helpText("@SYS88200");
            break;
        case DateExpectedConfirmedRequested::Confirmed:
            dateExpected.label("@SYS88228");
            dateExpected.helpText("@SYS88229");
            break;
        case DateExpectedConfirmedRequested::Requested:
            dateExpected.label("@SYS88230");
            dateExpected.helpText("@SYS88231");
            break;
    }
}

public boolean unpack(container packedClass)
{
    Integer version = conPeek(packedClass,1);

    switch (version)
    {
        case #CurrentVersion:
            [version,#CurrentList] = packedClass;
            break;
        default:
            return false;
    }

    return true;
}

display DateExpected dateToCompareWith(CustPackingSlipTrans _custPackingSlipTrans)
{
    date d;

    switch (enum.index2Value(basedOn.selection()))
    {
        case DateExpectedConfirmedRequested::Expected:
            d = _custPackingSlipTrans.SalesLineShippingDateConfirmed ?
                _custPackingSlipTrans.SalesLineShippingDateConfirmed : _custPackingSlipTrans.SalesLineShippingDateRequested;
            break;
        case DateExpectedConfirmedRequested::Confirmed:
            d = _custPackingSlipTrans.SalesLineShippingDateConfirmed;
            break;
        case DateExpectedConfirmedRequested::Requested:
            d = _custPackingSlipTrans.SalesLineShippingDateRequested;
            break;
    }

    return d;
}

private boolean compareRangeValues(str _r1, str _r2)
{   //the ranges like "1/2/2002.." and "1/2/2002 .." should be treated as equal.
    _r1 = strRTrim(subStr(_r1, 1, strLen(_r1)-2));
    _r2 = strRTrim(subStr(_r2, 1, strLen(_r2)-2));
    return (_r1 == _r2);
}

public void executeQuery()
{
    QueryBuildRange qbr = this.query().dataSourceTable(tableNum(CustPackingSlipTrans)).findRange(fieldNum(CustPackingSlipTrans, DeliveryDate));
    QueryBuildRange qbr1;

    if (daysFiltersApplied)
    {
        qbr.value(SysQuery::range(DateTimeUtil::getToday(DateTimeUtil::getUserPreferredTimeZone())-daysToLookBack.value(), null));
    }

    super();

    if (!daysFiltersApplied)
    {
        qbr1 = this.queryRun().query().dataSourceTable(tableNum(CustPackingSlipTrans)).findRange(fieldNum(CustPackingSlipTrans, DeliveryDate));
        if (qbr1 && !this.compareRangeValues(qbr1.value(), qbr.value()))
        {
            daysToLookBack.value(0);
        }
    }

    daysFiltersApplied = false;
}

display Days deviationDays(CustPackingSlipTrans _custPackingSlipTrans)
{
    Days days = 0;
    DateExpected expectedDate;

    if (_custPackingSlipTrans.DeliveryDate)
    {
        switch (enum.index2Value(basedOn.selection()))
        {
            case DateExpectedConfirmedRequested::Expected:
                expectedDate = _custPackingSlipTrans.SalesLineShippingDateConfirmed ?
                               _custPackingSlipTrans.SalesLineShippingDateConfirmed : _custPackingSlipTrans.SalesLineShippingDateRequested;
                days = expectedDate ? _custPackingSlipTrans.DeliveryDate - expectedDate : 0;
                break;
            case DateExpectedConfirmedRequested::Confirmed:
                days = _custPackingSlipTrans.SalesLineShippingDateConfirmed ?
                       _custPackingSlipTrans.DeliveryDate - _custPackingSlipTrans.SalesLineShippingDateConfirmed : 0;
                break;
            case DateExpectedConfirmedRequested::Requested:
                days = _custPackingSlipTrans.SalesLineShippingDateRequested ?
                       _custPackingSlipTrans.DeliveryDate - _custPackingSlipTrans.SalesLineShippingDateRequested : 0;
                break;
        }
    }

    return days;
}

